import React from 'react';

function Dashboard() {
    return (
        <div style={{ textAlign: "center", padding: "50px" }}>
            <h2>Dashboard</h2>
            <p>Track your progress and plan your learning here.</p>
        </div>
    );
}

export default Dashboard;
